def find_nth_ranked_participant(st, we, n):
    if not st:
        return 'No participants'
    if n >= len(we):
        return 'Not enough participants'

    def name_score(name, w):
        return w * (len(name) + sum((ord(c.lower()) - 96 for c in name)))
